        private void PopulateGrid()
        {
            DataTable SensorDT = new DataTable();

            try
            {
                SensorDT = CreateDataTable();
                gdvBulk.DataSource = SensorDT;
                gdvBulk.DataBind();

            }
            catch (Exception ex)
            {
                errorMessage.Visible = true;
                lblError.Text = "Error: " + ex.Message;
            }


        }
        private string getColumnLetter(int column)
        {
            string result = "";
            if ((column / 26) == 0)
            {
                result += Strings.ChrW(column + 65);
            }
            else
            {
                result += (Strings.ChrW((column / 26) + 64)).ToString() + (Strings.ChrW((column % 26) + 65)).ToString();
            }

            return result;
        }

        private string convertToA1(int row, int column)
        {
            return getColumnLetter(column) + (row + 1).ToString();
        }

        private DataTable CreateDataTable()
        {
            DataTable DT = new DataTable();
            int rowCount =Convert.ToInt32( txtNumberORows.Text);
            int columnCount = 12;
            try
            {
                //Create the Columns
                DT.Columns.Add("Type");
                DT.Columns.Add("IPAdress");
                DT.Columns.Add("Port");
                DT.Columns.Add("SerialPort");
                DT.Columns.Add("SerialSettings");
                DT.Columns.Add("ExtraData");
                DT.Columns.Add("ExtraData1");
                DT.Columns.Add("ExtraData2");
                DT.Columns.Add("ExtraData3");
                DT.Columns.Add("ExtraData4");
                DT.Columns.Add("ExtraData5");
                DT.Columns.Add("Caption");
                //Get the rows.
                //0 index is the headings
                
                for (int r = 1; r <= rowCount; r++)
                {
                    DataRow dr = DT.NewRow();
                    for (int c = 0; c <= columnCount - 1; c++)
                    {
                        Exceldoc1.Cell = convertToA1(r, c);
                        if (Exceldoc1.CellText.Trim().Length > 0)
                        {
                            if ((Exceldoc1.CellText.Contains("NULL") == false))
                            {
                                string calue = Exceldoc1.CellValue;
                                Type typee = default(Type);
                                typee = DT.Columns[c].DataType;
                                dynamic itemm = Convert.ChangeType(calue, typee);
                                dr[c] = itemm;
                            }
                            else
                            {
                                dr[c] = 0;
                            }
                        }
                        else
                        {
                            dr[c] = 0;
                        }
                    }
                    DT.Rows.Add(dr);
                }
                Session["SensorImportDT"] = DT;
                return DT;
            }
            catch (Exception ex)
            {
                errorMessage.Visible = true;
                lblError.Text = "Error: " + ex.Message;
                return null;
            }
        }

        protected void btnSubmit_Click(object sender, EventArgs e)
        {
            string imagenormalbyte = "";
            string imageErrorbyte = "";
            string imagenoresponsebyte = "";
            //create list of other  Device details.

            List<LiveMonitoring.IRemoteLib.OtherDevicesDetails> OtherdeviceDetailsList = new List<LiveMonitoring.IRemoteLib.OtherDevicesDetails>();

            try
            {
                foreach (GridViewRow row in gdvBulk.Rows)
                {
                    LiveMonitoring.IRemoteLib.OtherDevicesDetails sd = new LiveMonitoring.IRemoteLib.OtherDevicesDetails();
                    sd.Type = (LiveMonitoring.IRemoteLib.OtherDevicesDetails.DeviceType)Convert.ToInt32(row.Cells[0].Text);
                    sd.IPAdress = row.Cells[1].Text;
                    sd.Port = Convert.ToInt32(row.Cells[2].Text);
                    sd.SerialPort = Convert.ToInt32(row.Cells[3].Text);
                    sd.SerialSettings = row.Cells[4].Text;
                    sd.ExtraData = row.Cells[5].Text;
                    sd.ExtraData1 = row.Cells[6].Text;
                    sd.ExtraData2 = row.Cells[7].Text;
                    sd.ExtraData3 =Convert.ToInt32( row.Cells[8].Text);
                    sd.ExtraData4 = Convert.ToInt32(row.Cells[9].Text);
                    sd.ExtraData5 =Convert.ToInt32(row.Cells[10].Text);
                    sd.ImageNormalByte = System.Text.Encoding.UTF8.GetBytes(imagenormalbyte);
                    sd.ImageErrorByte = System.Text.Encoding.UTF8.GetBytes(imageErrorbyte);
                    sd.ImageNoResponseByte = System.Text.Encoding.UTF8.GetBytes(imagenoresponsebyte);
                    sd.Caption = row.Cells[11].Text;
                    // Add to list
                    OtherdeviceDetailsList.Add(sd);
                }

                //save the list of cameras
                LiveMonitoring.GlobalRemoteVars myrem = new LiveMonitoring.GlobalRemoteVars();
                bool boo = myrem.LiveMonServer.CreateBulkOtherDevice(OtherdeviceDetailsList);

                if (boo)
                {
                    successMessage.Visible = true;
                    lblSuccess.Text = "Saved Successfully!";
                }
                else
                {
                    throw new Exception("Did not save!");
                }
            }
            catch (Exception ex)
            {
                errorMessage.Visible = true;
                lblError.Text = ex.Message;
            }
        }
    }
